import React from "react";

const sumContractCosts = contracts => {
  let contractSum = 0;
  contracts.map(contract => {
    contractSum = contractSum + contracts.kosten;
  });
  return contractSum;
};

const sumBillCosts = bills => {
    let billSum = 0;
    bills.map(bill => {
      billSum = billSum + bill.kosten;
    });
    return billSum;
  };

const sumObj = props => {
  let contracts = props.contracts;
  let bills = props.bills;

  let contractSum = sumContractCosts(contracts);
  let billSum = sumBillCosts(bills);


  return (
    <div className="sumObj">
      <div>
        <form>
          <h3>Ihre Gesamtkosten:</h3>
          <ul>
            <li></li>
          </ul>
        </form>
      </div>
    </div>
  );
};

export default sumObj;
